const y="";

let u="";

function add(y,u){
   
    return (
        <h1>addition is {y+u}</h1>
    );
}

function sub(y,u){
   
    return (
        <h1>sub is {y-u}</h1>
    );
}

function mul(y,u){
   
    return (
        <p>Mult is {y*u}</p>
    );
}
function d(y,u){
   
    return (
        <p>Divide is {y/u}</p>
    );
}
export default add;

export  { sub , mul , d };
